import React, { Component } from "react";

class Form extends Component {
  handlleChange = () => {};

  handlesubmit = () => {};

  render() {
    return (
      <div>
        <form>
          <label name="name">my name:</label>
          <input onChange={this.handlleChange} type="text" />
          <button>submit</button>
        </form>
      </div>
    );
  }
}

export default Form;
